function ToDoRowItem(props) {
    const rowNumber = 1;
    const rowDes = 'Feed Dog';
    const rowAss = 'Eric';

    return(
        <tr>
            <th scope="row">{rowNumber}</th>
            <td>{rowDes}</td>
            <td>{rowAss}</td>
        </tr>
    )
}

export default ToDoRowItem;
